    else
    {
        $ExeArgs = $Command
    }

    [System.IO.Directory]::SetCurrentDirectory($pwd)

	
    $PEBytes64 = ""
    $PEBytes32 = ""

	if ($ComputerName -eq $null -or $ComputerName -imatch "^\s*$")
	{
